    false,nt"url": null,nt"notes": "The TIGER/Line shapefiles and related database
    files (.dbf) are an extract of selected geographic and cartographic information
    from then                                 U.S. Census Bureau's Master Address File
    / Topologically Integrated Geographic Encoding and Referencing (MAF/TIGER) Database
    (MTDB).n                                 The MTDB represents a seamless national
    file with no overlaps or gaps between parts, however, each TIGER/Line shapefile
    is designed ton                                 stand alone as an independent data
    set, or they can be combined to cover the entire nation.nn                                 The
    Topological Faces / Area Landmark Relationship File (FACESAL.dbf) contains a record
    for each face / area landmark relationship.n                                 Face
    refers to the areal (polygon) topological primitives that make up MTDB.  A face
    is bounded by one or more edges; its boundaryn                                 includes
    only the edges that separate it from other faces, not any interior edges contained
    within the area of the face.  The face ton                                 which
    a record in the Topological Faces / Area Landmark Relationship File (FACESAL.dbf)
    applies can be determined by linking to then                                 Topological
    Faces Shapefile (FACES.shp) on the permanent topological face identifier (TFID)
    attribute.  The area landmark to which an                                 record
    in the Topological Faces / Area Landmark Relationship File (FACESAL.dbf) applies
    can be determined by linking to the Arean                                 Landmark
    Shapefile (AREALM.shp) on the area landmark identifier (AREAID) attribute.  A face
    may be part of multiple area landmarks.n                                 An area
    landmark may consist of multiple faces.n            ",nt"license_title": null,nt"extras":
